import React, { useState, useEffect } from 'react';

const ViewUnassignedPackages = () => {
  const [packages, setPackages] = useState([]);

  useEffect(() => {
    fetch('http://localhost:8081/package/get-package')
      .then((response) => response.json())
      .then((data) => {
        const unassigned = data.filter((pkg) => !pkg.courier);
        setPackages(unassigned);
      })
      .catch((error) => console.error('Error fetching packages:', error));
  }, []);

  return (
    <div style={styles.container}>
      <h2 style={styles.heading}>View Unassigned Packages</h2>
      {packages.length > 0 ? (
        <table style={styles.table}>
          <thead>
            <tr>
              <th>ID</th>
              <th>Delivery Address</th>
              <th>Status</th>
            </tr>
          </thead>
          <tbody>
            {packages.map((pkg) => (
              <tr key={pkg.id}>
                <td>{pkg.id}</td>
                <td>{pkg.deliveryAddress}</td>
                <td>{pkg.status}</td>
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p>No unassigned packages available.</p>
      )}
    </div>
  );
};

const styles = {
  container: {
    padding: '20px',
    backgroundColor: '#f9f9f9',
    borderRadius: '10px',
  },
  heading: {
    color: '#d39db7',
    marginBottom: '20px',
  },
  table: {
    width: '100%',
    borderCollapse: 'collapse',
  },
};

export default ViewUnassignedPackages;
